function addToCart(product) {
  let cart = JSON.parse(localStorage.getItem("cart")) || [];
  let existing = cart.find(item => item.name === product.name);

  if (existing) {
    existing.quantity += 1;
  } else {
    cart.push({ ...product, quantity: 1 });
  }

  localStorage.setItem("cart", JSON.stringify(cart));
  updateCartCount();
  showToast(`${product.name} added to cart ✅`);
}
// Render products
// ✅ Render product list
if (productList) {
  products.forEach((product, index) => {
    const card = document.createElement("div");
    card.className =
      "bg-white rounded-2xl shadow-md overflow-hidden hover:shadow-xl transition flex flex-col";

    card.innerHTML = `
      <img src="${product.image}" alt="${product.name}" 
           class="w-full h-40 sm:h-48 object-cover">
      <div class="p-4 flex flex-col flex-grow">
        <div class="flex-1">
          <h3 class="text-lg sm:text-xl font-semibold text-gray-800">${product.name}</h3>
          <p class="text-gray-500 text-sm">${product.weight}</p>
        </div>
        <div class="mt-3 flex justify-between items-center">
          <p class="text-green-600 font-bold text-lg">₹${product.price}</p>
          <button data-index="${index}"
            class="add-to-cart bg-gradient-to-r from-green-500 to-green-700 text-white px-4 py-2 rounded-full hover:scale-105 transition text-sm sm:text-base">
            ➕ Add
          </button>
        </div>
      </div>
    `;
    productList.appendChild(card);
  });



  // Attach click listeners
  document.querySelectorAll(".add-to-cart").forEach((btn) => {
    btn.addEventListener("click", (e) => {
      const index = e.target.getAttribute("data-index");
      addToCart(products[index]);
    });
  });
}
// Update navbar cart count
function updateCartCount() {
  let cart = JSON.parse(localStorage.getItem("cart")) || [];
  let count = cart.reduce((sum, item) => sum + item.quantity, 0);
  document.getElementById("cart-count").textContent = count;
}

// Toast popup (instead of alert)
function showToast(message) {
  const toast = document.getElementById("toast");
  toast.textContent = message;
  toast.classList.remove("hidden");
  toast.classList.add("opacity-100");

  setTimeout(() => {
    toast.classList.add("hidden");
    toast.classList.remove("opacity-100");
  }, 2000);
}

// Run on page load
document.addEventListener("DOMContentLoaded", updateCartCount);
